How to update multiple fields (maxLength, maxBreadth or maxArea) of a document based on multiple conditions sent from req.body?<p>I want to store maximum length, breadth, area ever encountered from a request and store it in the database. In this case, anything can be maximum and based on that I want to update max values in the database for that particular field only.</p>
<pre><code>const body = {
  oID: 123, // Primary key
  length: 50,
  breadth: 50
};
</code></pre>
<pre><code>const { length, breadth } = body;
const currentArea = length * breadth;
</code></pre>
<pre><code>await totalArea.updateOne(
  { oID: 123 },
  {
    $set: { $maxLength: maxLength &lt; length ? length : $maxLength }, // I want to update the docs based on mongo query only since this won't work.
    $set: { $maxBreadth: maxBreadth &lt; breadth ? breadth : $maxBreadth },  // I want to update the docs based on mongo query only since this won't work.
    $set: { $maxArea: maxArea &lt; currentArea ? currentArea : $maxArea }  // I want to update the docs based on mongo query only since this won't work.
  },
  { upsert: true }
);
</code></pre>
<p>In the above example, I have demonstrated the logic using ternary operator and I want to perform the same operation using mongoDB query. i.e update a particular field while comparing it to existing fields from the database and update it if it satisfies the condition.</p>

