embedfield:
Axios response.data comprises an error, although the data seems to be correctly<p>Currently I am learning to code and wants to send data to MongoDb. When I console log goalData, the content is correctly what I entered in the input field, but logging the response.data, shows following content: {message: 'Unexpected token &quot; in JSON at position 0', stack: 'SyntaxError: Unexpected token &quot; in JSON at positio…ejections (internal/process/task_queues.js:82:21)'}. And there is no entry in my Database.
Here my code:</p>
<pre><code>const createGoal = async (goalData, token)=&gt;{
    const config = {
        headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
        },
    }
    console.log(config);
    console.log(goalData);
    const response = await axios.post(API_URL, goalData, config);
    console.log(response.data);
    return response.data;
}
</code></pre>
<p>Here is my goalsSlice, perhaps it makes it clearer:</p>
<pre><code>import {createSlice, createAsyncThunk} from &quot;@reduxjs/toolkit&quot;;
import goalsService from &quot;./goalsService&quot;;
const initialState = {
    goals:[],
    isLoading:false,
    isError:false,
    isSuccess:false,
    message:&quot;&quot;,
}
//Create new Goal
export const createGoal = createAsyncThunk('goals/create', async (goalData, thunkAPI)=&gt;{
    try{
        const token = thunkAPI.getState().auth.user.token
        return await goalsService.createGoal(goalData, 'utf-8', token)
    }catch(error){
        const message = (error.response 
                        &amp;&amp; error.response.data 
                         &amp;&amp; error.response.data.message) || error.message || error.toString()
                         return thunkAPI.rejectWithValue(message);
    }
})
//Get Goals
export const getGoals = createAsyncThunk(&quot;goals/getAll&quot;, async (_, thunkAPI)=&gt;{
    try{
        const token = thunkAPI.getState().auth.user.token
        return await goalsService.getGoals(token)
    } catch(error){
        const message = (error.response 
            &amp;&amp; error.response.data 
             &amp;&amp; error.response.data.message) || error.message || error.toString()
             return thunkAPI.rejectWithValue(message);
    }
})
//deleteGoal
export const deleteGoal = createAsyncThunk(&quot;goals/delete&quot;, async ( id, thunkAPI)=&gt;{
    try{
        const token = thunkAPI.getState().auth.user.token
        return await goalsService.deleteGoal(id, token)
    } catch(error){
        const message = (error.response 
            &amp;&amp; error.response.data 
             &amp;&amp; error.response.data.message) || error.message || error.toString()
             return thunkAPI.rejectWithValue(message);
    }
})         
export const goalsSlice = createSlice({
    name:&quot;goals&quot;,
    initialState, 
    reducers: {
        reset: state=&gt;initialState
    },
    extraReducers: (builder)=&gt;{
        builder
        .addCase(createGoal.pending, (state)=&gt;{
            state.isLoading = true;
        })
        .addCase(createGoal.fulfilled, (state, action)=&gt;{
            state.isLoading = false;
            state.isSuccess = true;
            state.goals.push(action.payload);
        })
        .addCase(createGoal.rejected, (state, action)=&gt;{
            state.isLoading = false;
            state.isError = true;
            state.message = action.payload
        })
        .addCase(getGoals.pending, (state)=&gt;{
            state.isLoading = true;
        })
        .addCase(getGoals.fulfilled, (state, action)=&gt;{
            state.isLoading = false;
            state.isSuccess = true;
            state.goals = action.payload
        })
        .addCase(getGoals.rejected, (state, action)=&gt;{
            state.isLoading = false;
            state.isError = true;
            state.message = action.payload
        })
        .addCase(deleteGoal.pending, (state)=&gt;{
            state.isLoading = true;
        })
        .addCase(deleteGoal.fulfilled, (state, action)=&gt;{
            state.isLoading = false;
            state.isSuccess = true;
            state.goals = state.goals.filter((goal)=&gt;goal._id !== action.payload.id)
        })
        .addCase(deleteGoal.rejected, (state, action)=&gt;{
            state.isLoading = false;
            state.isError = true;
            state.message = action.payload
        })
    }
})
export const {reset} = goalsSlice.actions
export default goalsSlice.reducer
</code></pre>
<p>My Server.js:</p>
<pre><code>const express = require(&quot;express&quot;);
const dotenv = require(&quot;dotenv&quot;).config();
const colors = require(&quot;colors&quot;);
const {errorHandler} = require(&quot;./middleware/errorMiddleware&quot;);
const connectDb = require(&quot;./config/db&quot;);
const port = process.env.PORT || 5000;
connectDb();

const cors = require('cors');
const app = express();

app.use(cors());
app.use(express.json());
app.use(express.urlencoded({extended:false}));

app.use(&quot;/api/goals&quot;, require(&quot;./routes/goalRoutes&quot;));
app.use(&quot;/api/users&quot;, require(&quot;./routes/userRoutes&quot;));

app.use(errorHandler);
app.listen(port, ()=&gt;console.log(`Server is running on Port ${port}`));
</code></pre>
<p>My goalsRoute:</p>
<pre><code>const express=require(&quot;express&quot;);
const router = express.Router();
const { getGoals, setGoal, updateGoal, deleteGoal } = require(&quot;../controller/goalController&quot;);
const {protect} = require(&quot;../middleware/authMiddleware&quot;);
router.route(&quot;/&quot;).get(protect, getGoals).post(protect, setGoal);
router.route(&quot;/:id&quot;).put(protect, updateGoal).delete(protect, deleteGoal);

module.exports = router;
</code></pre>
<p>My goalController:</p>
<pre><code>const asyncHandler = require(&quot;express-async-handler&quot;);
const Goal = require(&quot;../models/goalModel&quot;);
const User = require(&quot;../models/userModel&quot;);

const getGoals = asyncHandler(async (req,res)=&gt;{
    const goals = await Goal.find({ user: req.user.id });
    res.status(200).json(goals);
})
const setGoal = asyncHandler(async (req,res)=&gt;{
    if(!req.body.text){
        res.status(400)
        throw new Error(&quot;Please add a text field&quot;);
    }
    const goal = await Goal.create({
        text: req.body.text,
        user: req.user.id
    })
    res.status(200).json(goal);
})

const updateGoal = asyncHandler(async (req,res)=&gt;{
    const goal = await Goal.findByIdAndUpdate(req.params.id);

    if(!goal){
        res.status.apply(400);
        throw new Error(&quot;Goal not found&quot;);
    }
    if(!req.user){
        res.status(401)
        throw new Error(&quot;User not found&quot;);
    }
    if(goal.user.toString() !== req.user.id){
        res.status(401)
        throw new Error(&quot;Not authorized&quot;);
    }

    const updatedgoal = await Goal.findByIdAndUpdate(req.params.id, req.body, {new:true});
    res.status(200).json(updatedgoal);
})

const deleteGoal = asyncHandler(async (req,res)=&gt;{
    const goal = await Goal.findByIdAndDelete(req.params.id);
    if(!goal){
        res.status(400)
        throw new Error(&quot;Goal not found&quot;);
    }

     if(!req.user){
        res.status(401)
        throw new Error(&quot;User not found&quot;);
    }

    if(goal.user.toString() !== req.user.id){
        res.status(401)
        throw new Error(&quot;Not authorized&quot;);
    }

    await goal.deleteOne();
    res.status(200).json({id: req.params.id})
})

module.exports = {
    getGoals,
    setGoal,
    updateGoal,
    deleteGoal,
}
</code></pre>
<p>My goalModel:</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);

const goalSchema = mongoose.Schema(
    {
    text: {type:String, required:true},
    user:{type:mongoose.Schema.Types.ObjectId, required: true, ref:'User'},

}, {timestamps:true}
);

module.exports = mongoose.model(&quot;Goal&quot;, goalSchema);
</code></pre>
<p>Thanks for your help.</p>

