what is the best way to implement posts that expire after a period of time?<p>I am working on a react native &amp; MongoDB project that has posts which expire after 7 days from the time of creation. and then change the status to expired.</p>
<p><a href="https://i.stack.imgur.com/lltyU.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/lltyU.png" alt="enter image description here" /></a></p>
<p>I am currently thinking of checking at the start of each day for posts that will expire soon then notify the user, but how would I actually change the status to expired at the exact moment it expires?</p>
<p><strong>EDIT:</strong></p>
<p>For people from the future, this is how I did it :)</p>
<pre><code>const watchForExpired = () =&gt; {
  let interval = setInterval(async () =&gt; {
    let dateBeforeSevenDays = new Date();
    dateBeforeSevenDays.setDate(dateBeforeSevenDays.getDate() - 7);

    const listings = await Listing.find({
      $and: [
        {
          creationTime: { $lte: dateBeforeSevenDays },
        },
        {
          status: &quot;approved&quot;,
        },
      ],
    });

    if (listings.length === 0) return;

    const updateQuery = await Listing.updateMany(
      { _id: { $in: listings.map(({ _id }) =&gt; _id) } },
      { $set: { status: &quot;expired&quot; } },
      { multi: true }
    );
  }, 60000);
};
</code></pre>

