which has resulted in my entire database being exposed in JSON on example.com/api. For example, the first line of the page could be:</p>
<pre class="lang-json prettyprint-override"><code>[{&quot;_id&quot;:&quot;6168115af6bfc986c18f821d&quot;,&quot;name&quot;:&quot;test&quot;,&quot;age&quot;:&quot;20&quot;,&quot;__v&quot;:0},
</code></pre>
<p>It lists the entire database. How do I hide this?</p>
<p>My app.js file, as in the tutorial is:</p>
<pre class="lang-js prettyprint-override"><code>let express = require('express'),
  cors = require('cors'),
  mongoose = require('mongoose'),
  database = require('./database'),
  bodyParser = require('body-parser');


//connect mongoDB
mongoose.Promise = global.Promise;
mongoose.connect(database.db, {
  useNewUrlParser: true,
  useUnifiedTopology: true
}).then(() =&gt; {
  console.log(&quot;Database connected&quot;)
  },
  error =&gt; {
    console.log(&quot;Database couldn't be connected to: &quot; + error);
  }
)

const cryptoEndPoint = require('../backend/routes/crypto.route')
const app = express();
